svg.script:
var nb_regions=42;var svgdoc="";
var num_choisi=0,cible0="reg00",old_style="",figure="",message="";

function nommer(evt)
{if (figure=="") {dessin(evt);figure="OK"};
svgdoc=evt.getTarget().getOwnerDocument();
cible=evt.getTarget().getAttribute("id");
if (cible.substring(0,3)=="reg");
{numero=parseInt(cible.substring(3,5),10);
if (numero<10) {cible="reg0"+numero.toString(10)} else {cible="reg"+numero.toString(10)};
if (numero!=num_choisi)
{obj=evt.getTarget().getOwnerDocument().getElementById("nom");
obj.getStyle().setProperty("visibility","visible");
obj.setAttribute("x",donnees[numero][1]);obj.setAttribute("y",donnees[numero][2]);
child=obj.getFirstChild();child.setData(donnees[numero][0]);
if (cible0!="reg00") {obj=evt.getTarget().getOwnerDocument().getElementById(cible0);
obj.setAttribute("style",old_style)};
if (cible!="reg00") {obj=evt.getTarget().getOwnerDocument().getElementById(cible);
old_style=obj.getAttribute("style");obj.getStyle().setProperty("fill","yellow");
obj.getStyle().setProperty("fill-opacity","0.5");
obj=evt.getTarget().getOwnerDocument().getElementById("nom2");
if (message!="")
{k=message.indexOf(":",0);parametres=message.substring(k+1,message.toString().length);
message1=message.substring(0,k+1);k=parametres.indexOf(";",0);param1=parametres.substring(0,k);
col1=parseInt(param1);param2=parametres.substring(k+1,parametres.toString().length);
col2=parseInt(param2);
if (donnees[numero][col1]!="N/A")
{if (col2==-1) {valeur=donnees[numero][col1]} 
else {valeur=donnees[numero][col1]/donnees[numero][col2]};
valeur=Math.round(100*valeur)/100;message2=valeur.toString(10)} else {message2="?"}; 
message1=message1+" "+message2;obj.getStyle().setProperty("visibility","visible");
obj.setAttribute("x",donnees[numero][1]);obj.setAttribute("y",donnees[numero][2]+150);
child=obj.getFirstChild();child.setData(message1)} 
else {obj.getStyle().setProperty("visibility","hidden")}} 
else {obj=evt.getTarget().getOwnerDocument().getElementById("nom");
obj.getStyle().setProperty("visibility","hidden");
obj=evt.getTarget().getOwnerDocument().getElementById("nom2");
obj.getStyle().setProperty("visibility","hidden");};
num_choisi=numero;cible0=cible}}}

function dessin(evt)
{svgdoc=evt.getTarget().getOwnerDocument();
fig=svgdoc.getElementById("parametre");
child=fig.getFirstChild();param=new String(child.getData());
param=param.substring(1,param.length);
rempli=param.substring(0,1);param=param.substring(2,param.length);
k=param.indexOf("&",0);donne=new String(param.substring(0,k));param=param.substring(k+1,param.length);
j=donne.indexOf(";");col1=parseInt(donne.substring(0,j));
col2=parseInt(donne.substring(j+1,donne.length));
k=param.indexOf("&",0);couleur=new String(param.substring(0,k));param=param.substring(k+1,param.length);
coul=new Array();j=-1;i=couleur.indexOf(";");
while (i>=0) 
{j=j+1;coul[j]=couleur.substring(0,i);
couleur=couleur.substring(i+1,couleur.length);i=couleur.indexOf(";")};
coul[j+1]=couleur;
k=param.indexOf("&",0);motifs=new String(param.substring(0,k));param=param.substring(k+1,param.length);
motif=new Array();j=-1;i=motifs.indexOf(";");
while (i>=0) 
{j=j+1;motif[j]=motifs.substring(0,i);
motifs=motifs.substring(i+1,motifs.length);i=motifs.indexOf(";")};
motif[j+1]=motifs;
if (motif[0]>0) {for (j=0;j<6;j++) {coul[j]="url(#pattern"+motif[j].toString(10)+")"}};
k=param.indexOf("&",0);opacite=new String(param.substring(0,k));param=param.substring(k+1,param.length);
opacites=new Array();j=-1;i=opacite.indexOf(";");
if (i<0) {opacites[0]=opacite} else
{while (i>=0) 
{j=j+1;opacites[j]=opacite.substring(0,i);
opacite=opacite.substring(i+1,opacite.length);i=opacite.indexOf(";")};
opacites[j+1]=opacite};
k=param.indexOf("&",0);quartie=new String(param.substring(0,k));param=param.substring(k+1,param.length);
quartile=new Array();j=-1;i=quartie.indexOf(";");
if (i<0) 
{quartile[0]=quartie;
if (quartile[0]=="N") {nb_quartile=1} else {nb_quartile=parseInt(quartile[0])+1}} else
{while (i>=0) 
{j=j+1;quartile[j]=parseFloat(quartie.substring(0,i));
quartie=quartie.substring(i+1,quartie.length);i=quartie.indexOf(";")};
quartile[j+1]=parseFloat(quartie);nb_quartile=j+1};
if (coul[0]=="N") {coul[0]="#B7DDC8"};
if ((opacites[0]=="AUTO")||(opacites[0]=="N"))
{j=nb_quartile-1;
if (coul[1]=="N")
{for (i=0;i<=j;i++) {opaque=0.1+Math.round(9*i/j)*0.1;opacites[i]=opaque.toString()}}
else
{for (i=0;i<=j;i++) {opacites[i]="0.8"}}};
j=nb_quartile-1;for (i=1;i<=j;i++) {if ((coul[i]=="N")||(i>3)) {coul[i]=coul[0]}};
k=param.indexOf("&",0);symb=param.substring(0,k);param=param.substring(k+1,param.length);
k=param.indexOf("&",0);donne2=new String(param.substring(0,k));param=param.substring(k+1,param.length);
colo=new Array();j=-1;i=donne2.indexOf(";");
while (i>=0) 
{valeur=parseInt(donne2.substring(0,i));
if (valeur!=-1) {j=j+1;colo[j]=valeur};
donne2=donne2.substring(i+1,donne2.length);i=donne2.indexOf(";")};
colo[j+1]=parseInt(donne2);colo2=parseInt(donne2);
k=param.indexOf("&",0);couleur2=new String(param.substring(0,k));param=param.substring(k+1,param.length);
coul2=new Array();j=-1;i=couleur2.indexOf(";");
while (i>=0) 
{j=j+1;coul2[j]=couleur2.substring(0,i);
couleur2=couleur2.substring(i+1,couleur2.length);i=couleur2.indexOf(";")};
coul2[j+1]=couleur2;
if (coul2[0]=="N") {coul2[0]="red"};
k=param.indexOf("&",0);opacite=new String(param.substring(0,k));param=param.substring(k+1,param.length);
if (opacite=="N") {opacite2="0.5"} else {opacite2=opacite.toString(10)};
k=param.indexOf("&",0);taille=new String(param.substring(0,k));
j=taille.indexOf(";");
if (j<0) {dmin=parseFloat(taille);dmax=4*mini} 
else {dmin=parseFloat(taille.substring(0,j));dmax=parseFloat(taille.substring(j+1,taille.length))};
if (rempli=="0") {uniforme("reg",coul[0],opacites[0]);message=""};
if (rempli=="1") {degrades("reg",col1,col2,quartile,coul,opacites);
if (col2==-1) {message=donnees[0][col1]+":"} 
else {message=donnees[0][col1]+"/"+donnees[0][col2]+":"};
message=message+col1.toString(10)+";"+col2.toString(10)};
if (rempli=="2") {colorie("reg",col1,quartile,coul,opacites);message=donnees[0][col1]+":"+col1+";-1"};
if (symb=="1") {disques(colo[0],colo2,dmin,dmax,coul2[0],opacite2,"cercle","cercles")};
if (symb=="2") {symboles(colo[0],colo2,dmin,dmax,opacite2,"maison","symboles")};
if (symb=="3") {camembert(colo,dmin,"pie","pie")};
if (symb=="6") {symboles(colo[0],colo2,dmin,dmax,opacite2,"dollar","symboles")};
if (symb=="4") {barres(colo[0],colo2,dmin,dmax,coul2,opacite2,["barre1","barre2"],"barres")};
if (symb=="5") {histogramme(colo,dmin,dmax,coul2,opacite2,["histo1","histo2","histo3"],"histo")}}
